import React, { useState } from "react";
import "./index.css"

const App=()=>{
    let newcolor ="#"+Math.floor(Math.random()*999999+111111)
    const[color,setcolor] = useState()
    function run(){
        setcolor(newcolor)
    }
    return(
        <div onLoad={run} style={{backgroundColor:color}}>
            <button onClick={run}>click me!</button>
        </div>
    )
}
export default App
